import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <div className="container">
        <Link to="/">
          <div className="logo-placeholder">MAS</div>
          <span style={{ fontSize: '1.25rem', fontWeight: 'bold' }}>MARVY AGRIC SOLUTIONS</span>
        </Link>
        <nav>
          <Link to="/">Home</Link>
          <Link to="/services">Our Services</Link>
          <Link to="/honors">Honors and Awards</Link>
          <Link to="/careers">Careers</Link>
          <Link to="/contact">Contact Us</Link>
        </nav>
      </div>
    </header>
  );
};

export default Header;
